import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ProductListComponentComponent } from './ProductsModule/Infrastracture/Components/product-list-component/product-list-component.component';
import { ProductsRepositoryService } from './ProductsModule/Infrastracture/Persistence/Repositories/products-repository.service';
import { IProductsRepository } from './ProductsModule/Core/Domain/Repositories/IProductsRepository';
import { INumberEqualCondition, INumberEqualService, NUMBER_EQUAL_CONDITIONS, NumberBeetween3And5, NumberIsEven, NumberIsOdd } from './ProductsModule/Core/Services.Abstractions/INumberEqualService';
import { ICounter } from './ProductsModule/Core/Services.Abstractions/ICounter';
import { NumberCounterService } from './ProductsModule/Core/Services/number-counter.service';
import { NumberEqualService } from './ProductsModule/Core/Services/number-equal.service';


@NgModule({
  declarations: [
    AppComponent,
    ProductListComponentComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: 
  [
    { provide: NUMBER_EQUAL_CONDITIONS, useValue: [
      new NumberIsEven(),
      new NumberIsOdd()
    ]},
    {provide: IProductsRepository, useClass: ProductsRepositoryService},
    {provide: ICounter, useClass: NumberCounterService },
    {provide: INumberEqualService, useClass: NumberEqualService },
    // {provide: INumberEqualCondition, useClass: NumberIsEven, multi: true},
    // {provide: INumberEqualCondition, useClass: NumberIsOdd, multi: true},
    // {provide: INumberEqualCondition, useClass: NumberBeetween3And5, multi: true}
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
